import React from 'react';

function Card({props, card, onCardClick}) {

  function handleClick() {
    onCardClick(props.card);
  }  


  return (
    <article className="place">
      <img className="place__image" alt={props.name} src={props.link} onClick={handleClick} />
      <div className="place__info">
        <h2 className="place__name">{props.name}</h2>
        <div className="place__reaction">
          <button type="button" className="place__like" aria-label="Нравится"></button>
          <span className="place__like-count">{props.card.likes.length}</span>
        </div>
      </div>
      <button type="button" className="place__delete" arial-label="Удалить"></button>
    </article>
  );
}

export default Card;
